import React from "react";
import "./Add.css";
//import FoodCard from "./Foodcard.jsx";
import { useState } from "react";
import MenuIcon from '@mui/icons-material/Menu';
function Add() {
    const [isMenuOpen, setIsMenuOpen] = useState(false);
    const toggleMenu = () => {
        setIsMenuOpen(!isMenuOpen);
      };
    const year = new Date().getFullYear();
    const [previewImage, setPreviewImage] = useState(null);
    const handleImageChange = (e) => {
        const file = e.target.files[0];

        if (file) {
            const reader = new FileReader();
            reader.onloadend = () => {
                setPreviewImage(reader.result);
            };
            reader.readAsDataURL(file);
        } else {
            setPreviewImage(null);
        }
    };
    return (
      <div>
        <div className="home-container">
            <div className="menu">
                <button className="menu-btn" onClick={toggleMenu}>
                    <MenuIcon/>
                </button>
                {isMenuOpen && (
                    <div className="dropdown">
                    <button className="menu-item">Contact</button>
                    <button className="menu-item">About Us</button>
                    </div>
                )}
            </div>
            <div className="tit">
                <h2><img src="/images/f3.png" alt=""/>FOOD NETWORK</h2>
            </div>
            <div className="buttons-container">
                <button className="log-btn">Login</button>
                <button className="sig-btn">Sign In</button>
            </div>
        </div>
        


        <div className="card-container">
            <div className="body-content">
            <div className="input-box">
                        <label>Image Details:</label>
                        <input
                            type="file"
                            id="imageInput"
                            accept="image/*"
                            onChange={(e) => handleImageChange(e)}
                        />
                        <img
                            src={previewImage}
                            alt="Preview"
                            className="image-preview"
                        />
                    </div>
                    <div className="input-box">
                        <label>Food Name:</label>
                        <input type="text" placeholder="Enter food name" />
                    </div>
                    <div className="input-box">
                        <label>Donor:</label>
                        <input type="text" placeholder="Enter donor" />
                    </div>
                    <div className="input-box">
                        <label>Quality:</label>
                        <input type="text" placeholder="Enter quality" />
                    </div>
                    <div className="input-box">
                        <label>Quantity:</label>
                        <input type="text" placeholder="Enter quantity" />
                    </div>
                    <div className="input-box">
                        <label>Condition:</label>
                        <input type="text" placeholder="Enter condition" />
                    </div>
                    <div className="input-box">
                        <label>Food Type:</label>
                        <input type="text" placeholder="Enter food type" />
                    </div>
                
            </div>
            <button className="add-btn">Submit</button>
        </div>



        <div className="footer">
            <h3>Copyright ⓒ {year}</h3>
        </div>
      </div>
    );
  }
  
  export default Add;
